<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Animated Minikits Grid</title>
  <style>
    body {
      background: #181818;
      margin: 0;
      padding: 0;
      font-family: Arial, sans-serif;
    }
    .grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(100px, 1fr));
      gap: 4px;
      row-gap: 4px;
      padding: 32px;
      max-width: 1600px;
      margin: 0 auto;
    }
    .grid img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      border-radius: 4px;
      box-shadow: 0 4px 16px rgba(0,0,0,0.2);
      opacity: 1;
      /* transform: translateY(60px); */
      /* animation: riseIn 0.8s cubic-bezier(.23,1.02,.62,1) forwards; */
    }
    .grid img:nth-child(n) {
      animation-delay: calc(0.05s * var(--i));
    }
    @keyframes riseIn {
      to {
        opacity: 1;
        transform: translateY(0);
      }
    }
    @keyframes scrollUp {
      0% { transform: translateY(0); }
      100% { transform: translateY(-50%); }
    }
    .grid {
      animation: scrollUp 10s linear infinite;
      will-change: transform;
    }
  </style>
</head>

    const grid = document.getElementById('minikitGrid');
    const imageCount = 150; // Change this to the actual number of images

    function getRandomGradient() {
      const angle = Math.floor(Math.random() * 360);
      const color1 = `hsl(${Math.floor(Math.random() * 360)}, 70%, 60%)`;
      const color2 = `hsl(${Math.floor(Math.random() * 360)}, 70%, 40%)`;
      return `linear-gradient(${angle}deg, ${color1}, ${color2})`;
    }

    for(let i=1; i<=imageCount; i++) {
      const div = document.createElement('div');
      // div.style.padding = '8px';
      // div.style.aspectRatio = '1 / 1';
      // div.style.background = getRandomGradient();
      const img = document.createElement('img');
      div.appendChild(img);


      img.style.background = getRandomGradient();
      img.src = `26_minikits/${items[i]}`;
      img.alt = `Minikit ${i}`;
      img.style.setProperty('--i', i);
      grid.appendChild(div);
    }
